DROP TABLE IF EXISTS `buyCar`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `buyCar` (
  `id` varchar(20) NOT NULL COMMENT '主键',
  `khid` varchar(20) NOT NULL COMMENT '客户ID号',
  `goodsId` varchar(20) NOT NULL COMMENT '商品表ID号',
  `goodsSkuId` varchar(52) NOT NULL COMMENT '商品规格id号',
  `goodsName` varchar(255) NOT NULL COMMENT '商品名称',
  `goodsSkuName` varchar(500) NOT NULL COMMENT '商品规格名称',
  `buyNumber` int(11) NOT NULL COMMENT '购买数量',
  `buyPrice` decimal(10,2) NOT NULL COMMENT '规格单价，需要根据数量判断',
  `workFlow` varchar(20) NOT NULL COMMENT '订单流程（未选定/已选定/已付款/已发货/已收货/已评价/已退货）',
  `updateTime` datetime NOT NULL COMMENT '更新时间',
  `time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';
