--
-- Table structure for table `order`
--

DROP TABLE IF EXISTS `order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `o_type` tinyint(1) NOT NULL COMMENT '1、购买订单，2、积分订单',
  `order_sn` char(22) NOT NULL COMMENT '订单号',
  `out_order_sn` varchar(50) NOT NULL DEFAULT '' COMMENT '外部订单号',
  `pay_type` varchar(20) NOT NULL COMMENT '在线支付/银行转账',
  `pay_type_online` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0、未支付，1、线下转账，2、微信，3、支付宝，4、银联',
  `pay_khid` varchar(20) NOT NULL COMMENT '付钱的用户id',
  `target_khid` varchar(50) NOT NULL COMMENT '得到货的用户id',
  `money` decimal(10,0) NOT NULL COMMENT '本次需要支付的总金额或积分',
  `workFlow` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0、待支付，1、待发货，2、待收货，3、已收货，4、待评价，5、已完成，6、已申请退款，7、已退款，8、申请退货，9、同意退货',
  `extra_info` varchar(500) NOT NULL DEFAULT '' COMMENT '备注',
  `address_name` varchar(30) NOT NULL COMMENT '收货人',
  `address_tel` varchar(20) NOT NULL COMMENT '收货人电话',
  `region_id` int(11) NOT NULL COMMENT '省市区表id',
  `address_detail` varchar(200) NOT NULL COMMENT '收货人详细地址',
  `deli_type` varchar(20) NOT NULL DEFAULT '' COMMENT '发货类型：快递，物流，等，占位',
  `express_name` varchar(20) NOT NULL DEFAULT '' COMMENT '快递名称',
  `express_number` varchar(30) NOT NULL DEFAULT '' COMMENT '快递单号',
  `tax_type` varchar(10) NOT NULL DEFAULT '' COMMENT '纸质发票，电子发票',
  `tax_title` varchar(30) NOT NULL DEFAULT '' COMMENT '发票抬头，个人，公司',
  `tax_num` varchar(30) NOT NULL DEFAULT '' COMMENT '公司的税号',
  `ptime` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
  `updateTime` datetime NOT NULL COMMENT '更新时间',
  `ctime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='支付记录表';
/*!40101 SET character_set_client = @saved_cs_client */;

